import { Box, Paper } from "@material-ui/core";
import axios from "axios";
import { useEffect, useState } from "react";

interface CountType {
  branchCount: number;
  clientCount: number;
  contractCount: number;
  contactCount: number;
}
const Count = () => {
  const [count, setCount] = useState<CountType>(null);

  useEffect(() => {
    axios
      .get("/api/count/getDashboardData")
      .then(({ data }) => {
        setCount(data);
        console.log(data);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <Box m={5}>
      <Paper elevation={3}>Branch Count {count.branchCount}</Paper>
      <Paper elevation={3}>Client Count {count.clientCount}</Paper>
      <Paper elevation={3}>ContactPerson Count {count.contractCount}</Paper>
      <Paper elevation={3}>Contract Count {count.contractCount}</Paper>
    </Box>
  );
};

export default Count;
